In Python, the `@` symbol is used for two main purposes:

1. **Decorators**: Decorators are a way to modify or enhance functions or methods. They are typically used to add functionality without modifying the code of the function being decorated.

   ```python
   @some_decorator
   def some_function():
       pass
   ```

   When the interpreter encounters this line, it automatically calls `some_decorator(some_function)` before actually running `some_function`.

2. **Property Access**: In Python 3.3 and later, the `@` symbol can be used with the `property` function to define descriptors. However, this usage is less common and more complex than using it with decorators.

   ```python
   class MyClass:
       @property
       def my_property(self):
           return self._my_property

       @my_property.setter
       def my_property(self, value):
           self._my_property = value
   ```

Here's a simple example of a decorator:

```python
def my_decorator(func):
    def wrapper():
        print("Something is happening before the function is called.")
        func()
        print("Something is happening after the function is called.")
    return wrapper

@my_decorator
def say_hello():
    print("Hello!")

say_hello()  # Output: 
# Something is happening before the function is called.
# Hello!
# Something is happening after the function is called.
```

Using decorators allows you to wrap behavior around other functions or methods without repeating the logic each time you call them. This makes your code cleaner and more maintainable.

