```cpp
#include <iostream>
#include <fstream>
#include <string>
#include <sstream>

int countWordOccurrences(const std::string& filePath, const std::string& targetWord) {
    std::ifstream inputFile(filePath);
    if (!inputFile.is_open()) {
        std::cerr << "Unable to open file: " << filePath << std::endl;
        return -1;
    }

    int occurrences = 0;
    std::string line;

    while (getline(inputFile, line)) {
        std::istringstream iss(line);
        std::string word;
        while (iss >> word) {
            if (word == targetWord) {
                ++occurrences;
            }
        }
    }

    inputFile.close();
    return occurrences;
}

int main() {
    std::string filename = "example.txt"; // Change this to your input file path
    std::string wordToCount = "example_word"; // Change this to the word you want to count

    int count = countWordOccurrences(filename, wordToCount);

    if (count != -1) {
        std::cout << "The word '" << wordToCount << "' appears " << count << " times in the file." << std::endl;
    }

    return 0;
}
```

### Explanation:
1. **Input File Handling**: The program opens the specified file using `std::ifstream`. If the file cannot be opened, an error message is printed and `-1` is returned.
2. **Reading Lines**: The program reads the file line by line using `getline()`.
3. **Word Counting**: Each line is processed line by line using a `std::istringstream`. This allows for efficient tokenization of words.
4. **Comparing Words**: For each word in a line, the program checks if it matches the target word. If they match, the count is incremented.
5. **Output**: After processing all lines, the program prints the total number of occurrences of the target word.

### Instructions:
